export const Licenses = () => {
  //================ 👇گرفتن همه مجوزها 📍 ====================
  const handleGetAllLicenses = async () => {
    const res = await getAllLicenses();
    console.log(res.data.data);
  };
  useEffect(() => {
    handleGetAllLicenses();
  }, []);
  // ======================= 👇return ==========================
  return (
    <>
      <div className="px-4 productGroupManagement">
        <UpperPartPages title="مدیریت مجوزهای دسترسی" />
        <Reusable_table
            nameOfColumn={handle_header_discountsTable(
              data,
              setData,
              setDiscountToEdit
            )}
            dataOfRows={data}
            placeholder_searchBox="قسمتی از عنوان را وارد کنید"
            having_searchBox={true}
            modal_addButton={true}
            modal_compo={handleAddDiscounts(discountToEdit, setDiscountToEdit)}
          />
      </div>
    </>
  );
};
